ctHolder.getValue(); // ÂèåÈáçÈîÅ, Â¶ÇÊûúÊ≤°ÊúâÂëΩ‰∏≠ÂàôË∞ÉÁî® createExtension() if (value == null) { synchronized (cachedInstances) { value = objectHolder.getValue(); if (value == null) { value = createExtension(name); objectHolder.setValue(value); } } } return (T) value; } \",\"private T createExtension(final String name) { // ÂÖ≥ÈîÆ‰ª£Á†Å, ÊêúÁ¥¢Ê†áËØÜÂØπÂ∫îÁöÑÁ±ªÂØπË±° Class<?> aClass = getExtensionClasses().get(name); if (aClass == null) { throw new IllegalArgumentException(\\\"name is error\\\"); } // joinInstances ÁêÜËß£‰∏∫Á¨¨‰∫åÂ±ÇÁºìÂ≠ò, K-V Â≠òÊîæÁ±ªÂØπË±°‰∏éÂÖ∂ÂàùÂßãÂåñÂØπË±° Object o = joinInstances.get(aClass); if (o == null) { try { joinInstances.putIfAbsent(aClass, aClass.newInstance()); o = joinInstances.get(aClass); } catch (InstantiationException | IllegalAccessException e) { // ... } } return (T) o; } \",\"public Map<String, Class<?>> getExtensionClasses() { // cachedClasses ‰∏∫Á¨¨‰∏âÂ±ÇÁºìÂ≠ò, Â≠òÊîæÊ†áËØÜ‰∏éÁ±ªÂØπË±°Êò†Â∞Ñ Map<String, Class<?>> classes = cachedClasses.getValue(); if (classes == null) { synchronized (cachedClasses) { classes = cachedClasses.getValue(); if (classes == null) { // ÊûÑÈÄ† classes ÁºìÂ≠ò, classes ÁöÑ K-V ÁªìÊûÑ‰∏∫ Ê†áËØÜ-Á±ªÂØπË±° classes = loadExtensionClass(); cachedClasses.setValue(classes); } } } return classes; } \",\"private Map<String, Class<?>> loadExtensionClass() { // ÊãøÂà∞Êé•Âè£ÁöÑ SPI Ê≥®Ëß£ SPI annotation = clazz.getAnnotation(SPI.class); if (annotation != null) { String value = annotation.value(); if (StringUtils.isNotBlank(value)) { cachedDefaultName = value; } } // ÊûÑÈÄ† classes ÁºìÂ≠ò, classes ÁöÑ K-V ÁªìÊûÑ‰∏∫ Ê†áËØÜ-Á±ªÂØπË±° Map<String, Class<?>> classes = new HashMap<>(16); loadDirectory(classes); return classes; } \",\"private void loadDirectory(final Map<String, Class<?>> classes) { String fileName = SOUL_DIRECTORY + clazz.getName(); try { ClassLoader classLoader = ExtensionLoader.class.getClassLoader(); // ËØªÂèñ SPI ËµÑÊ∫êÊñá‰ª∂ Enumeration<URL> urls = classLoader != null ? classLoader.getResources(fileName) : ClassLoader.getSystemResources(fileName); if (urls != null) { while (urls.hasMoreElements()) { URL url = urls.nextElement(); // ÊûÑÈÄ† classes ÁºìÂ≠ò, classes ÁöÑ K-V ÁªìÊûÑ‰∏∫ Ê†áËØÜ-Á±ªÂØπË±° loadResources(classes, url); } } } } \",\"private void loadResources(final Map<String, Class<?>> classes, final URL url) throws IOException { try (InputStream inputStream = url.openStream()) { Properties properties = new Properties(); properties.load(inputStream); // Ëß£ÊûêËµÑÊ∫êÊñá‰ª∂‰∏∫ KV ÁªìÊûÑ properties.forEach((k, v) -> { String name = (String) k; String classPath = (String) v; if (StringUtils.isNotBlank(name) && StringUtils.isNotBlank(classPath)) { try { // Âä†ËΩΩË∑ØÂæÑ, ‰º†ÂÖ• classes ÁºìÂ≠ò„ÄÅÊ†áËØÜ„ÄÅÁ±ªË∑ØÂæÑ loadClass(classes, name, classPath); } catch (ClassNotFoundException e) { throw new IllegalStateException(\\\"load extension resources error\\\", e); } } }); } } \",\"private void loadClass(final Map<String, Class<?>> classes, final String name, final String classPath) throws ClassNotFoundException { // Â∞ÜËµÑÊ∫êÊñá‰ª∂‰∏≠ÁöÑÁ±ªË∑ØÂæÑÂèçÂ∞ÑÊàêÁ±ªÂØπË±° Class<?> subClass = Class.forName(classPath); // ÊãøÂà∞ÂÆûÁé∞Á±ªÁöÑ Join Ê≥®Ëß£ Join annotation = subClass.getAnnotation(Join.class); Class<?> oldClass = classes.get(name); if (oldClass == null) { // ÊîæÂÖ•ÂÖ•ÂèÇ classes ÁºìÂ≠ò‰∏≠, K-V ÂΩ¢Âºè‰∏∫ Ê†áËØÜ-Á±ªÂØπË±° classes.put(name, subClass); } } \"]},\"298\":{\"h\":\"SoulÁΩëÂÖ≥Â≠¶‰π†SignÊèí‰ª∂\"},\"299\":{\"h\":\"‰ªãÁªç\",\"t\":[\"sign Êèí‰ª∂Áî®Êù•ÂØπËØ∑Ê±ÇËøõË°åÁ≠æÂêçËÆ§ËØÅÁöÑÊèí‰ª∂\"]},\"300\":{\"h\":\"AK/SK ‰ªãÁªç\",\"t\":[\"AK/SKÔºàAccess Key ID/Secret Access KeyÔºâÂç≥ËÆøÈóÆÂØÜÈí•ÔºåÂåÖÂê´ËÆøÈóÆÂØÜÈí• IDÔºàAKÔºâÂíåÁßòÂØÜËÆøÈóÆÂØÜÈí•ÔºàSKÔºâ‰∏§ÈÉ®ÂàÜÔºå‰∏ªË¶ÅÁî®‰∫éÂØπÁî®Êà∑ÁöÑË∞ÉÁî®Ë°å‰∏∫ËøõË°åÈâ¥ÊùÉÂíåËÆ§ËØÅ„ÄÇ\"]},\"301\":{\"h\":\"Êèí‰ª∂‰ΩøÁî®-‰ª•Ôºà/dubbo/findAllÔºâ‰∏∫‰æã\"},\"302\":{\"h\":\"Âú® SoulBootstrap ÁöÑ pom.xml Êñá‰ª∂‰∏≠Ê∑ªÂä† sign ÁöÑÊîØÊåÅ\",\"t\":[\" <!-- soul sign plugin start--> <dependency> <groupId>org.dromara</groupId> 